import React, { Component } from 'react';

class Footer extends Component {
  render() {
    return (
        <footer>
            
            <div className="logo">
                LOGO LINK HERE
            </div>

            <nav>
                <ul>
                    <li>
                        <a href="#">Home</a>
                    </li>
                    <li>
                        <a href="#">Experience</a>
                    </li>
                    <li>
                        <a href="#">Contact</a>
                    </li>
                </ul>
            </nav>
        </footer>
    );
  }
}

export default Footer;
